import React, { Component } from "react";
import Carousel from "react-bootstrap/Carousel";
class PhotoLibrary extends Component {
  state = {
    key: "fda8922284b87b4f38775239ea65f173",
    secret: "60f4b8039d57b683",
    photos: []
  };
  componentDidMount() {
    fetch(
      "https://www.flickr.com/services/rest/?method=flickr.galleries.getPhotos&api_key=fda8922284b87b4f38775239ea65f173&gallery_id=66911286-72157647277042064&format=json&nojsoncallback=1"
    )
      .then(data => data.json())
      .then(data => {
        //console.log(data.photos.photo);

        let displayHtml = data.photos.photo.map(obj => {
          const imageUrl =
            "https://farm" +
            obj.farm +
            ".staticflickr.com/" +
            obj.server +
            "/" +
            obj.id +
            "_" +
            obj.secret +
            ".jpg";
          //console.log(imageUrl);
          return <img key={obj.id} src={imageUrl} alt="" />;
        });
        console.log(displayHtml);
        this.setState({ photos: displayHtml });
        console.log(this.state.photos);
      });
  }
  render() {
    return (
      <Carousel>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src="holder.js/800x400?text=First slide&bg=373940"
            alt="First slide"
          />
          <Carousel.Caption>
            <h3>First slide label</h3>
            <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src="holder.js/800x400?text=Second slide&bg=282c34"
            alt="Third slide"
          />

          <Carousel.Caption>
            <h3>Second slide label</h3>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src="holder.js/800x400?text=Third slide&bg=20232a"
            alt="Third slide"
          />

          <Carousel.Caption>
            <h3>Third slide label</h3>
            <p>
              Praesent commodo cursus magna, vel scelerisque nisl consectetur.
            </p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
    );
  }
}

//https://farm9.staticflickr.com/8187/8432423659_dd1b834ec5.jpg
//https://farm{farm-id}.staticflickr.com/{server-id}/{id}_{secret}.jpg

export default PhotoLibrary;
